import React from 'react';

export default class Header extends React.Component {
  constructor(props) {
    super(props);

    this.handlerClick = this.handlerClick.bind(this);
  }

  handlerClick(e) {
    console.log(e);
  }

  render() {
    if (document.location.pathname === '/') {
      return (
        <header>
          <div className="container">
            <div className="split">
              <div className="split_left">
                <a href="#" className="heading">
                  Minecraft-Schule
                </a>
              </div>
              <div className="split_right">
                <nav>
                  <a href="/who-we-are" className="header_button active">
                    WHO WE ARE
                  </a>
                  <a href="/how-we-work" className="header_button">
                    HOW WE WORK
                  </a>
                  <a href="what-we-do" className="header_button">
                    WHAT WE DO
                  </a>
                  <img
                    className="header_icon lupa"
                    src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR7Ka13r27y8vpYbhAhshK_8k4MMIonx75Rh-w0hvCxwmJfNFQPKbqkRuMn8jSFdnnEaHk&usqp=CAU"
                    alt="Search"
                  />
                  <img
                    className="header_icon menu"
                    src="https://static.thenounproject.com/png/3187934-200.png"
                    alt="Menu"
                  />
                </nav>
              </div>
            </div>
          </div>
        </header>
      );
    }
  }
}
